\ub0b4\ub2e4 \uc0c1\uc138 \uc0c1\uc138 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uace0\ud608\uc555 \uac00\uc871 \ud608\uad00 \uac74\uac15 \uac71\uc815 \ub3fc\ub2e4 \ud608\uad00 \uc88b\ub2e4 \uc624\uba54\uac00 \uc54c\uc544\ubcf4\ub2e4 \uc0dd\uc120 \ub9cc\ub4e4\ub2e4 \ub3d9\ubb3c\uc131 \uc624\uba54\uac00 \ub298\ub2e4 \uc911\uae08\uc18d \uc704\ud5d8 \ud574\uc870\ub958 \uc624\uba54\uac00 \uad6c\ub9e4 \uc784\uc0b0\ubd80 \uc18c\ub9ac \ubbff\ub2e4 \uad6c\ub9e4 \uc624\uba54\uac00 \ub298\ub2e4 \ud608\uad00 \uc911\uc131 \uc9c0\ubc29 \ub179\uc774\ub2e4 \ud608\uad00 \uccad\uc18c \ud574\uc8fc\ub2e4 \ud608\uc561 \uc21c\ud658 \ub3c4\uc640\uc8fc\ub2e4 \ubd88\uaddc\uce59\ud558\ub2e4 \uc2b5\uad00 \uc911\uc131 \uc9c0\ubc29 \uac71\uc815 \ud544\uc694\ud558\ub2e4 \uc591\uc81c \ub365\ub2e4 \ucf54\uc5d4\uc790\uc784 \ud050\ud150 \ud765\uad6d \ucf54\uc5d4\uc790\uc784 \ud050\ud150 \ubcc4\uba85 \uc2ec\uc7a5 \ube44\ud0c0\ubbfc \uc2ec\uc7a5 \ud38c\ud54c \ub3c4\uc640\uc8fc\ub2e4 \ud608\uc561 \uc21c\ud658 \uc88b\ub2e4 \ub3c4\uc640\uc8fc\ub2e4 \ub300\uc694 \ud765\uad6d \uc88b\ub2e4 \ucf5c\ub808\uc2a4\ud2b8\ub864 \ub192\uc774\ub2e4 \ub098\uc058\ub2e4 \ucf5c\ub808\uc2a4\ud14c\ub864 \ub0ae\ucd94\ub2e4 \ud608\uad00 \ub354\uc6b1 \uad00\ub9ac \uc88b\ub2e4 \uc591\uc81c \uba39\uae30 \uac00\uaca9 \ubd80\ub2f4 \uac2f\uc218 \ub9ce\uc544\uc9c0\ub2e4 \uba39\uae30 \uc26c\ub2e4 \uc368\ub2e4 \uc2dc\uc548 \ubaa8\ub4e0 \uc88b\ub2e4 \ub2e4\uac00 \uba74\uc5ed \uc88b\ub2e4 \ud608\uad00 \uc810\ub9c9 \uc88b\ub2e4 \uc62c\uc778\uc6d0 \ud608\uad00 \uad00\ub9ac\uc81c \ub044\ub2e4 \ub2eb\ub2e4 \uc0c1\uc138 \uc0c1\uc138 \uc0c1\uc138", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4 \uae30\uac04 \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc54c\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1", "\uac00\uaca9 \uad1c\ 0\uc5b4\ub098\ub2e4 \uc81c\ud488 \uad1c\ucc2e\ub2e4 \uafb8\uc900\ud558\ub2e4 \uc787\ub2e4 \ub2e4\ub974\ub2e4 \ubc14\uafb8\ub2e4 \uc787\ub2e4 \uc0c1\uc138", "\ud53c\ubd80 \uc88b\uc544\uc9c0\ub2e4 \uad6c\uc785 \ud53c\ub85c \uac10\ub2e4 \uc904\uc5b4\ub4e4\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud0c0\uc9c0 \uc624\ub9e4 \ub77c\uc11c \ubbff\ub2e4 \uad6c\ub9e4 \uac00\uc131 \uc88b\ub2e4", "\ubc30\uc1a1 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ub450\ud1b5 \uc7ac\ub2e4 \uac10\ub9c8 \ub9ac\ub180\ub80c\uc0b0 \ud568\uc720\ub7c9 \ub192\ub2e4 \uacfc\uc815 \uad1c\ucc2e\ub2e4 \ud3b8\uc774 \ubbff\ub2e4 \ubcf5\uc6a9 \uc911\uc774 \uac1c\uc778 \uc804\ud654\ubc88\ud638 \uc5f0\ub77d \uce58\uc57d \uadc0\ucc2e\ub2e4 \uae30\ub3c4 \uac1c\uc778 \ubc88\ud638 \uc5f0\ub77d \uc0ac\uc740 \ud488\ub2e4 \uaebc\ub9ac\ub2e4 \ud2c0\ub2e4 \uad6c\ub9e4 \uc0c1\uc138 \uc0c1\uc138", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4 \ud56d\uc0c1 \uc7c1\uaca8\ub193 \uc591\uc81c \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc81c\ud488 \uace0\uae09\uc2a4\ub7fd\ub2e4 \ucea1\uc290 \uc539\ub2e4 \uc7ac\ubbf8 \uc800\ub834\ud558\ub2e4 \uc81c\ud488 \uae68\ub2e4 \ud488\uc9c8 \uc88b\ub2e4", "\ud53c\ubd80 \uc88b\ub2e4 \ube44\ud0c0\ubbfc \uc0ac\uba74 \uad6c\uc785 \uc88b\ub2e4 \uafb8\uc900\ud558\ub2e4 \uad6c\ub9e4", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4 \uafb8\uc900\ud558\ub2e4 \ubcf5\uc6a9 \uac74\uac15 \ubcf4\uc870 \uc2dd\ud488 \uc0c1\uc138", "\uc800\ub834\ud558\ub2e4 \uc0ac\ub2e4 \uc5ed\uc2dc \ubd84\ub9d0 \uba39\uae30 \ud798\ub4e4\ub2e4 \uae30\ub2e4 \ubb3c\uc774 \uafc0\uaebd \uafc0\uaebd \ub9c8\uc2dc\ub2e4 \uc54c\uc57d \uac00\ub8e8 \uc2a4\ud47c \ub05d\ub098\ub2e4 \uac00\ub8e8 \ub0ab\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ubd80\ubaa8\ub2d8 \ub4dc\ub9ac\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud608\uc555 \ub192\ub2e4 \uc778\ud130\ub137 \ucc3e\uc544\ubcf4\ub2e4 \ud3c9\uc774 \uc88b\ub2e4 \uad6c\ub9e4 \uba85\uc131 \uac74\uac15 \uc88b\uc544\uc9c0\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\uac00\uaca9 \uc2f8\ub2e4 \uc0ac\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4 \uc88b\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc88b\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc88b\ub2e4", "\uac00\uaca9 \uc2f8\ub2e4 \ubc30\uc1a1", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4 \uad6c\ub9e4 \ud574\ubcf4\ub2e4 \ucc28\uadfc\ucc28\uadfc \uc54c\ub2e4 \uc131\ubd84 \uc88b\ub2e4 \uad6c\ub9e4 \uc624\uba54\uac00 \ucf54\uc5d4\uc790\uc784 \uc5fd\uc0b0 \uc81c\ud488 \uad6c\ub9e4 \uad6c\ub9e4 \uba39\uae30 \uadc0\ucc2e\ub2e4 \uac00\uaca9 \uc810\ub3c4 \ub2e4\uc2dc \uad6c\ub9e4 \uc0c1\uc138", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4 1\ub144 \uad6c\ub9e4 \ubcf5\uc6a9 \uc815\ud655\ud558\ub2e4 \uac80\uc0ac \ud574\ubcf4\ub2e4 \uc218\uce58 \ubaa8\ub974\ub2e4 \ubb34\uac70 \uc950\ub2e4 \ud655\uc2e4\ud558\ub2e4 \uc88b\uc544\uc9c0\ub2e4 \uc88b\ub2e4 \uc601\ud5a5 \ubbff\ub2e4 \uc2f6\ub2e4 \uad6c\ub9e4 \uc81c\ud488 \ubd84\ub9ac \ud798\ub4e4\ub2e4 \ub2e4\uc2dc \ubd84\ub9ac \uc27d\ub2e4 \uc0c1\uc138 \uc0c1\uc138 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ucf5c\ub808\uc2a4\ud14c\ub864 \uce58\uac00 \ub192\ub2e4 \ub3c4\uc6c0 \ud6c4\uae30 \uad6c\ub9e4 \ud6c4\uae30 \ub2e4\uc2dc \uc62c\ub9ac\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ub9d1\ub2e4 \uae30\ubd84 \uc88b\ub2e4 \uae30\ub300\ud558\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1", "\uac00\uaca9 \uc2f8\ub2e4 \uc0ac\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4 \uc2f8\ub2e4 \uc0ac\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1 \uafb8\uc900\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uad6c\ub9e4 \uc81c\ud488 \ubbff\ub2e4 \uc7ac\ub2e4", "\ub9cc\uc871\ud558\ub2e4 \uc8fc\ubcc0 \uc9c0\uc778 \uc18c\uac1c \ub2ec\ub9de\uc774\uaf43 \uc790\uc720 \uad6c\ub9e4 \uc88b\ub2e4 \uc88b\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \ud608\uc561 \uc21c\ud658 \uc88b\ub2e4 \uafb8\uc900\ud558\ub2e4 \ub298\ub2e4 \uc190\ubc14\ub2e5 \ub530\ub73b\ud558\ub2e4 \uae30\ubd84 \uc0c1\uc138", "\ub9cc\uc871 \uc88b\ub2e4 \uc8fc\ubb38 \ub298\ub2e4 \uc787\ub2e4 \ud1b5\uc99d \ub9cc\uc871\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uad6c\uc785 \uc81c\ud488 \ub5a8\uc5b4\uc9c0\ub2e4 \uad6c\uc785 \uac31\ub144\uae30 \ub3c4\uc6c0 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uad6c\ub9e4 \ud608\uc561 \uc21c\ud658 \ub3c4\uc6c0 \ud30c\ub2e4", "\uac00\uaca9 \uc2f8\ub2e4 \uc0ac\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4 \uc2f6\ub2e4 \uac04\ub9cc \uc0ac\ubcf4\ub2e4 \ud6a8\ub2a5 \ubaa8\ub974\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uac00\uc871 \uc800\ub834\ud558\ub2e4 \uad6c\ub9e4 \uc88b\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud06c\ub9b4 \uc624\uc77c \uc88b\ub2e4 \uad6c\ub9e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uac10\uc0ac\ud558\ub2e4 \uac10\uc0ac\ud558\ub2e4", "\uac00\uaca9 \uc2f8\ub2e4 \uc0ac\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4 \uc88b\ub2e4 \uc0ac\ub2e4 \uaf3c\uaf3c\ud558\ub2e4 \ud3ec\uc7a5 \ubcf4\ub0b4\ub2e4 \uac10\uc0ac \ub4dc\ub9ac\ub2e4", "\uc54c\ub2e4 \ub123\ub2e4 \ube44\ud0c0\ubbfc \uc2e0\ub791 \ube8f\ub2e4 \uc787\ub2e4 \ub9c8\uad6c", "\uac00\uaca9 \uc2f8\ub2e4 \uc0ac\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4 \ud544\uc218\ud488 \uad6c\ub9e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ub450\ubc88\uc9f8 \uad6c\ub9e4 \uc88b\ub2e4 \uc0c1\uc138", "\ubcf5\uc6a9 \ud3c9\uac00 \uc5b4\ub835\ub2e4 \uc2e0\uc18d\ud558\ub2e4 \ubc30\uc1a1 \ub9cc\uc871\ud558\ub2e4 \uae30\uc0ac \uac10\uc0ac", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ub450\ubc88\uc9f8 \uad6c\ub9e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ubc8c\uc368 \uc138\ubc88 \uad6c\ub9e4 \uc2e0\uae30\ud558\ub2e4 \uc0dd\ub9ac \uc99d\ud6c4\uad70 \uc5c6\uc5b4\uc9c0\ub2e4 \uc0dd\ub9ac \ub2ec\ub2e4 \ub561\uae30\ub2e4 \uc9dc\uc99d\ub098\ub2e4 \uc608\ubbfc\ud558\ub2e4 \uadf8\ub807\ub2e4 \uc99d\uc0c1 \uc5c6\uc5b4\uc9c0\ub2e4 \uba39\uace0\ub2e4 \uc2f6\ub2e4 \uac00\uaca9 \ube44\uc2f8\ub2e4 \ud6a8\ub2a5 \uc88b\ub2e4 \uc774\ud574 \ubd80\ub2f4\uc2a4\ub7fd\ub2e4 \uac08\uc544\ud0c0\ub2e4 \uc8fc\ubb38 \uac00\uaca9 \uac10\uc0ac\ud558\ub2e4 \uc0c1\uc138", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1 \uac00\uaca9 \uc88b\ub2e4", "\ubc30\uc1a1 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uc801\ub2f9\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ubaa8\ub974\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3b8\ud558\ub2e4 \ucfe0\ud3f0 \ucc29\ud558\ub2e4 \uac00\uaca9 \uad6c\ub9e4 \ubcf4\ub0b4\ub2e4 \uc138\uc2ec \ubc30\ub824 \uac10\uc0ac \ub4dc\ub9ac\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\ubc30\uc1a1 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\uc720\ud1b5 \uae30\ud55c \ud3ec\uc7a5 \uc0c1\ud0dc", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc624\uba54\uac00 \ud64d\uad6d \ucf54\ud050\ud150 \uc88b\ub2e4 \ud655\uc2e4\ud558\ub2e4 \uc624\uba54\uac00 \uc88b\ub2e4 \ud3b8\ud558\ub2e4 \uc88b\ub2e4 \uad6c\ub9e4 \uc9dc\ub2e4 \uad6c\uc131 \uc800\ub834\ud558\ub2e4 \ub2e8\uac00 \uac10\uc0ac\ud558\ub2e4 \ub2eb\ub2e4 \uc0c1\uc138 \uc0c1\uc138 \uc0c1\uc138", "\ubc30\uc1a1 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uace0\ud608\uc555 \uba39\uae30 \ub2e8\uacc4 \uc2ec\uc0ac\uc219\uace0 \ubcf5\uc6a9 \ubcf5\uc6a9 \ubcc0\ud654 \ub290\ub07c\ub2e4 \uafb8\uc900\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ub3d9\ubb3c\uc131 \uc624\uba54\uac00 \uc911\uae08\uc18d \ud574\uc870\ub958 \uc624\uba54\uac00 \uad6c\ub9e4 \uc5ed\uc2dc \uc2dd\ubb3c\uc131 \uadf8\ub807\ub2e4 \ube44\ub9ac\ub2e4 \uba39\uae30 \uc88b\ub2e4 \ud608\uc561 \uc21c\ud658 \uace0\uc9c0\ud608\uc99d \ucf5c\ub808\uc2a4\ud14c\ub864 \uc218\uce58 \uc88b\uc544\uc9c0\ub2e4 \uc2e0\uae30\ud558\ub2e4 \uafb8\uc900\ud558\ub2e4 \ud608\uc555 \ub192\ub2e4 \ubd84\ud558\ub2e4 \uc88b\ub2e4 \ub2eb\ub2e4 \uc0c1\uc138 \uc0c1\uc138 \uc0c1\uc138", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4 \uad6c\ub9e4 \ubc30\uc1a1 \uc608\uc815\uc77c \uc81c\uc870 2\uc6d4 \uc720\ud1b5 \uae30\ud55c \uae30\ub2e4 \uc88b\ub2e4 \uc0c1\uc138 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc138\ubc88 \uad6c\ub9e4 \uc9c0\uc18d \ubcf5\uc6a9 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \ubaa8\ub974\ub2e4 \uafb8\uc900\ud558\ub2e4 1\ub144 \ud608\uad00 \uad00\ub9ac \ub93c\ud574", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1 \uc88b\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ubc30\uc1a1 \ube60\ub974\ub2e4 \uc88b\ub2e4", "\ubc30\uc1a1 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ube60\ub974\ub2e4 \ubc30\uc1a1 \uac10\uc0ac\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc800\ub834\ud558\ub2e4 \uad6c\uc785", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc544\ub9c8\uc874 \uad6c\ub9e4 \ubc30\uc1a1 \ube60\ub974\ub2e4 \uac00\uaca9 \ubd80\ub2f4 \uc88b\ub2e4", "\ucd95\ucc99 \uc9c0\ubc29 \ubd84\ud574 \uc88b\ub2e4 \ud3ec\uc2a4 \ud30c\ud2f0 \ucf5c\ub9b0 \ub54c\uba54 \uc0ac\uba39\ub2e4 \ud568\ub7c9 \uac00\uc131 \uc88b\ub2e4 \uc54c\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ube0c\ub9ac \uac10\ub9c8 \uc88b\ub2e4 11 \ubc88\uac00 \uc800\ub834\ud558\ub2e4 \uc0ac\ub2e4 \ubc30\uc1a1 \ube60\ub974\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uc784\uc2e0 \uc900\ube44 \ub450\ubc88\uc9f8 \uad6c\ub9e4 \ud568\ub7c9 \uc801\ub2f9\ud558\ub2e4 \uad1c\ucc2e\ub2e4 \ubd80\uc9c0\ub7f0\ud558\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uac31\ub144\uae30 \ud06c\ub2e4 \uae30\ub300 \uc88b\ub2e4 \uc5bc\uad74 \ud654\ub048 \uac70\ub9bc \ub450\ub4dc\ub7ec\uae30 \uc9c0\ub974\ub2e4 \ud53c\ubd80 \ub2e4\ub2c8\ub2e4 \ud574\ubcf4\ub2e4 \uc2e0\uacbd \uc368\ub2e4 \ubcf4\ub77c \uc9c0\uc720 \uad1c\ucc2e\ub2e4 \uc9c0\ub2e4 \uac83\ub55c \ubaa8\ub974\ub2e4 \ub2e4\ub974\ub2e4 \ubcf4\ub77c \uc9c0\uc720 \uac10\uc0ac\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \ub9db\uc788\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc0ac\uc740 \uce58\uc57d \uc8fc\uc2dc \ubc30\uc1a1 \ube60\ub974\ub2e4 \ud30c\ub2e4", "\uc720\ud1b5 \uae30\ud55c \ud3ec\uc7a5 \uc0c1\ud0dc \uc601\uc591 \uc81c\ub77c \uac10\uc0ac\ud558\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc88b\ub2e4 \ub0a8\uae30\ub2e4 \uc54c\ub2e4 \uae30\ud68c \ub2e4\uc2dc \uc0c1\ud488 \ub0a8\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud56d\uc0c1 \uadf8\ub807\ub2e4 \ubcd1\uc6d0 \uc758\uc0ac \uc624\uba54\uac00", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4 \uc911\ud559\uc0dd \ube44\uc5fc \uc2ec\ud574 \uc2dd\ud488 \ubcd1\ud589 \uad6c\ub9e4 \uae30\ub300 \ud574\ubcf4\ub2e4", "\ucd94\ud558\ub2e4 \uc67c\uc190 \ud608\uc561 \uc21c\ud658 \uc88b\ub2e4 \ub9ac\ubdf0 \uc62c\ub77c\uc624\ub2e4 \uc8fc\ubb38 \ubcf4\ub984 \uc774\uc9c0 \uc548\ub2e4 \ucd94\ucc9c \uc81c\ud488", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc0dd\ub9ac \ubed0\uadfc\ud558\ub2e4 \uc644\ud654 \uad6c\uc
